import React from 'react';
import { NavigationContainer } from '@react-navigation/native';

import RouterDetail from './src/MainContainer';
import RouterBar from './src/BottomBarContainer';

const App = () => {

  return (
    <NavigationContainer>
      <RouterDetail/>
      <RouterBar/>
    </NavigationContainer>
  );
};

export default App;
